function byte2Hex(n) {
	let nybHexString = "0123456789ABCDEF";
	return String(nybHexString.substr((n >> 4) & 0x0F, 1)) + nybHexString.substr(n & 0x0F, 1);
}

function expireTimeCountDown(minute) {
	let countDownDate = new Date().getTime() + (1000 * 60 * 60 * minute);

	// Update the count down every 1 second
	let x = setInterval(function () {

		// Get today's date and time
		let now = new Date().getTime();

		// Find the distance between now and the count down date
		let distance = countDownDate - now;

		// Time calculations for days, hours, minutes and seconds
		let days = Math.floor(distance / (1000 * 60 * 60 * 24));
		let hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
		let minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
		let seconds = Math.floor((distance % (1000 * 60)) / 1000);
		expireTime = hours + ":" + expireTimezeroview(minutes) + ":" + expireTimezeroview(seconds);

		// If the count down is over, write some text
		if (distance < 0) {
			clearInterval(x);
			expireTime = "EXPIRED";
		}
    $(".tada-expire-time").html('<span class="time-ticker">' + expireTime + '</span>' + ' left!');
		$(".tada-floating-dialog-expire-time").html(expireTime);
    $("#present_time_reminder_1 span").html('<span class="time-ticker-floating">' + expireTime + '</span>' + ' left!');
    $(".tada-game-expire-in-wrapper span:last-child").html(expireTime);
	}, 1000);
}

function expireTimezeroview (time) {
  if(time > 9) {
    return time;
  } else {
    return '0'+time;
  }
}

